/** @format */

import styled from "styled-components";

function Header() {
  return (
    <HeaderWrapper>
      <img src="./images/logo.svg" alt="Tesla Logo"></img>
      <ul>
        <li>Model S</li>
        <li> Model 3</li>
        <li>Model X</li>
        <li>Model Y</li>
        <li>Solar Roof</li>
        <li>Solar Panels</li>
      </ul>
      <ul>
        <li>Shop</li>
        <li> Account</li>
        <li>Menu</li>
      </ul>
    </HeaderWrapper>
  );
}

export default Header;

const HeaderWrapper = styled.div`
  background-color: green;
  max-width: 91rem;
  width: 100%;
  margin: 0 auto;
  padding-top: 1rem;
  width: 100%;
  display: flex;
  justify-content: space-between;
  background-size: cover;
  background-position-y: bottom;
  position: fixed;
  align-items: center;
`;
